import React from 'react';
import { Button, Linking, ScrollView, StyleSheet, Text, View } from 'react-native';
import { useState } from 'react';

export default function App() {

  const [ItemsS, setItems] = useState([
    { key: 1, item: 'Num : 1' },
    { key: 2, item: 'Num : 2' },
    { key: 3, item: 'Num : 3' },
    { key: 4, item: 'Num : 4' },
    { key: 5, item: 'Num : 5' },
    { key: 6, item: 'Num : 6' },
    { key: 7, item: 'Num : 7' },
    { key: 8, item: 'Num : 8' },
    { key: 9, item: 'Num : 9' },
    { key: 10, item: 'Num : 10' },
    { key: 11, item: 'Num : 12' },
    { key: 12, item: 'Num : 13' },
    { key: 13, item: 'Num : 14' },
    { key: 14, item: 'Num : 15' },
    { key: 15, item: 'Num : 16' },
    { key: 16, item: 'Num : 17' },
    { key: 17, item: 'Num : 18' },
    { key: 18, item: 'Num : 19' },
  ]
  )

  return (
    <ScrollView  style={styles.item}>

      {ItemsS.map((item) => {
        return (
          <Text style={styles.Text}>
            {item.item}
          </Text>
        )
      })
      }

    </ScrollView>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    alignContent : 'center',

    backgroundColor: '#fff',
